// Qanelas-Regular.js
// Сгенерировано через ttf2js или https://gerhardberger.github.io/ttf2js/
// Пример подключения кастомного шрифта для jsPDF
// ВАЖНО: Замените window.QanelasRegularFontData на реальный base64-код из ttf2js
window.QanelasRegularFontData = {
  fontName: 'Qanelas',
  fontStyle: 'normal',
  base64: '', // <-- сюда вставить base64 из ttf2js
  fontWeight: 'normal'
};

(function() {
  if (!window.jspdf || !window.jspdf.jsPDF) return;
  const jsPDF = window.jspdf.jsPDF;
  if (window.QanelasRegularFontData && window.QanelasRegularFontData.base64) {
    jsPDF.API.events.push(['addFonts', function() {
      this.addFileToVFS('Qanelas-Regular.ttf', window.QanelasRegularFontData.base64);
      this.addFont('Qanelas-Regular.ttf', 'Qanelas', 'normal');
    }]);
  }
})();
